import React from "react";

function Profile(props) {
  return (
    <div>
      {props.array.map((el) => (
        <div>
          <h1>Name : {el.names}</h1>
          <h1>Bio : {el.bio}</h1>
          <h1>Profession : {el.profession}</h1>
          <img src={props.children}/>
        </div>
      ))}   
    </div>
  );
}

export default Profile;
